import React, { useEffect, useState } from "react";
import AddEditUser from "./AddEditUser";
import Pagination from "../../components/Paginaion/Pagination";
import { Modal, ModalFooter, ModalHeader } from "reactstrap";
import WebService from "../../utility/WebService";
import tim from "../../assets/img/tim.png";
import Search from "../../components/Search/Search";
import toast from "react-hot-toast";
import { limit } from "../../components/common/list";
import Breadcrumb from "../../components/Breadcrumb/Breadcrumb";
import Table from "../../components/Table/Table";

const Userlist = () => {

    const [modelName, setModelName] = useState<any>({ name: "", id: 0 });
    const [keyword, setKeyword] = useState("");

    const onCloseModal = () => {
        setModelName("");
    }

    const localheaders = [
        {
            title: "Id",
            id: "id",
        },
        {
            title: "User Name",
            id: "userName",
        },
        {
            title: "Action",
        },
    ];

    const localdata = [
        {
            title: 1,
            id: "id",
        },
        {
            title: "User",
            id: "userName",
        }
    ];

    const getlist = () => {
        for (var i in localdata) {
            let columns: GridColumn[] = [];
            columns.push({ value: res.list[i]?.date + " (" + res.list[i]?.time + " - " + (res.list[i]?.timeTo || "") + ")" });
            columns.push({ value: res.list[i]?.meetingSource });
            columns.push({ value: getCoustomer(res.list[i]?.customers) });
            columns.push({ value: res.list[i]?.staffname });
            columns.push({ value: res.list[i]?.serviceName });
            columns.push({ value: res.list[i]?.location });
            columns.push({ value: res.list[i]?.categoryName });
            columns.push({ value: res.list[i]?.group_name });
            columns.push({ value: res.list[i]?.bookedBy });
            columns.push({ value: res.list[i]?.createDateTime ? res.list[i]?.createDateTime : "" });
            columns.push({ value: actionList(res.list[i]) });
            rows.push({ data: columns });
        }
    }

    return (
        <>
            <div className="row">
                <div className="col-12">
                    <Breadcrumb outerPage="Dashboard" mainPage="User Table" />
                </div>
                <div className="col-12">
                    <div className="card">
                        <div className="card-header align-items-center d-flex">
                            <div className="col-12 col-md-4 mb-2 mb-md-0">
                                <Search keyword={keyword} setKeyword={setKeyword} />
                            </div>
                            <div className="col-12 col-md-8 d-grid d-md-flex justify-content-md-end">
                                <button className="btn btn-light" onClick={() => { setModelName({ name: "AddEditUser", id: 0 }) }}>Add</button>
                            </div>
                        </div>
                        <div className="card-body">
                            <Table
                                Header={true}
                                HeaderList={localheaders}
                                rows={localdata}
                                Checkbox={true}
                            />
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Userlist;
